Here's a basic CSS script that you can use as a starting point:
```
/* Global Styles */

* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

body {
  font-family: Arial, sans-serif;
  background-color: #f9f9f9;
}

/* Typography */

h1, h2, h3, h4, h5, h6 {
  font-weight: bold;
  color: #333;
}

p {
  font-size: 16px;
  line-height: 24px;
  margin-bottom: 20px;
}

/* Buttons */

button {
  background-color: #4CAF50;
  color: #fff;
  border: none;
  padding: 10px 20px;
  font-size: 16px;
  cursor: pointer;
}

button:hover {
  background-color: #3e8e41;
}

/* Containers */

.container {
  max-width: 1200px;
  margin: 40px auto;
  padding: 20px;
  background-color: #fff;
  border: 1px solid #ddd;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
}
```
This script sets up some basic styles for typography, buttons, and containers.

