Here is a CSS script with some basic styling:
```
/* Global Styles */

* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

body {
  font-family: Arial, sans-serif;
  background-color: #f9f9f9; /* light gray */
}

/* Header Styles */

header {
  background-color: #333; /* dark gray */
  color: #fff; /* white */
  padding: 1em;
  text-align: center;
}

/* Main Content Styles */

main {
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 2em;
}

section {
  background-color: #fff; /* white */
  padding: 1em;
  margin-bottom: 20px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
}

h1 {
  font-size: 24px;
  margin-top: 0;
}

p {
  font-size: 16px;
  margin-bottom: 20px;
}
```
This script includes:

* Basic global styles (box model, margins, and padding)
* Header styles (dark gray background, white text, and centered text)
* Main content styles (flex layout, centered items, and white background)
* Section styles (white background, padding, margin bottom, and box shadow)
* H1 and paragraph styles (font sizes and margins)

